import React from 'react';
import './Filter_cat.css';

const Filter_cat = ({ cat, isChecked, onChange }) => {
  const handleInputChange = (event) => {
    onChange(cat, event.target.checked);
  };

  return (
    <div className="filter-cat">
      <label>
        <input type="checkbox" name="cat" checked={isChecked} onChange={handleInputChange} />
        {cat}
      </label>
    </div>
  );
};

export default Filter_cat;
